import { configureStore, createSlice } from '@reduxjs/toolkit'

let searchData = createSlice({
    name : 'searchData',
    initialState : [],
    reducers : {
        changeSearch(state){
            return state
        }
    }
});


export default configureStore({
  reducer: {
      searchData : searchData.reducer
  }
})
